import './main.css';
import logo from '../../img/logo.png';

function createContainer(content, className) {
    return(
        <div className={`container `}>
            {content}
        </div>
    )
}

export default function MainComp() {
    const pictureLogo = <img className="my-logo" src={logo} alt="logo" />;
    
    return(
        <main>
            {createContainer(pictureLogo)}
        </main>
    )
}
